import React from 'react';
import {CarouselData} from './carousel_data';
import img1 from './carousel_img/chain.jpg';
import img2 from './carousel_img/753.jpg';
import img3 from './carousel_img/about.jpg';
import img4 from './carousel_img/two.jpg';

class CarouselInner extends React.Component{
  render(){
    return(
      <div>
      <h1>Flash Box</h1>
           <h6>We are the solution for your shipping problem</h6>
           <span className='capspan'>Anytime, anywhere and on time.</span>
      {CarouselData.map((item) => {
        <div className="carousel-inner">
          <div className="carousel-item">
            <center><img src="./carousel_img/chain.jpg"/></center>
            <div className="carousel-caption">
            <h1>Flash Box</h1>
                 <h6>We are the solution for your shipping problem</h6>
                 <span className='capspan'>Anytime, anywhere and on time.</span>
            </div>
          </div>
        </div>
      })}
      </div>
    )
  }
}
export default CarouselInner
